import React,{Component} from 'react';
import './contact.scss';
import 'tachyons';
import FormInput from './FormInput.js';
import CustomButton from './CustomButton.js';
import { FaGithub,FaWhatsapp,FaFacebookF } from "react-icons/fa";
import { GoMail } from "react-icons/go";
import { AiFillLinkedin,AiFillTwitterCircle } from "react-icons/ai";
import insta from './insta.svg';

const initialState = {
	email: '',
	name: '',
  message:''
}

class Contact extends Component {
  constructor(props) {
    super(props);
    this.state = initialState;
  }
  handleSubmit = (event) => {
		event.preventDefault();
		this.setState({email: '', password: ''});
	}

	handleChange = (event) => {
		const {value, name} = event.target;
		this.setState({[name]: value});
	}
  render(){

    return (
      <>
      <div className="container" data-aos="fade-left"  data-aos-offset="200" data-aos-duration='1000'>
      <div className='left'>

      <h1 className="mb3">Contact Us</h1>
      <div className="bb bw2 center mt3" style={{width:'35vw'}} ></div>
      <form onSubmit={this.handleSubmit}>
      <FormInput
      label="Name"
      name="name"
      type="text"
      value={this.state.name}
      handleChange={this.handleChange}
      required
      />
      	<FormInput
      	label="Email"
      	name="email"
      	type="email"
      	value={this.state.email}
      	handleChange={this.handleChange}
      	required
      	/>
      	<FormInput
      	label='Message'
      	name="message"
      	type="text"
      	value={this.state.message}
      	handleChange={this.handleChange}
      	required
      	/>
      	<CustomButton type="submit">Contact Us</CustomButton>
      </form>
      </div>
			<div>
			<h1>Useful Links</h1>
			<div className="bb bw2 center mt3" style={{width:'35vw'}} ></div>

      <div className='right'>
			<div className="mt4 mr6">
      <div className="links grow mb4"> <a href="#" className="a"> <FaGithub size="2em" color="#e88f0a" className="mr2 grow"/></a></div>
      <div  className="links  grow mb4"> <a href="#" className="a"><AiFillTwitterCircle size="2em" color="#e88f0a"  className="mr2 grow"/></a></div>
			</div>
			<div className="mt4 mr6">
      <div className="links grow mb4">  <a href="#" className="a"><img src={insta} height="30px" width="30px" className="mr2 grow"/></a></div>
      <div className="links grow mb4"> <a href="#" className="a"> <AiFillLinkedin size="2em" color="#e88f0a" className="mr2 grow"/></a></div>
			</div>
			<div className="mt4">
			<div className="links grow mb4">  <a href="#" className="a"><FaFacebookF size="2em" color="#e88f0a" className="mr2 grow"/></a></div>
			<div className="links grow mb4"> <a href="#" className="a"> <FaWhatsapp size="2em" color="#e88f0a" className="mr2 grow"/></a></div>
			</div>
      </div>
						<h1>Head Office</h1>
						<div className="bb bw2 center mt3" style={{width:'35vw'}} ></div>
      </div>
      </div>
      <footer className="footer mt6">developed by debugged.exe</footer>
      <footer  className="footer">   software engineers</footer>

</>
    );
  }
}

export default Contact;
